/* Header.css */

.header {
    background-color: black;
    padding-top: 1rem;
    padding-bottom: 1rem;
    color: white;
    border-bottom: 1px solid #d1d5db; /* border-gray-400 */
  }
  
  .container {
    max-width: 1200px;
    margin: 0 auto;
    padding-left: 2.5rem; /* px-10 */
    padding-right: 2.5rem; /* px-10 */
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  
  .navbar {
    display: flex;
    gap: 1.75rem; /* gap-7 */
  }
  
  .hire-button {
    padding: 0.5rem 1.5rem;
    border: 1px solid #9615db;
    background-color: #bd59d3;
    color: white;
    font-weight: bold;
    transition: all 0.3s ease;
  }
  
  .hire-button:hover {
    background-color: #932daa;
    border-color: #932daa;
  }
  
  .mobile-nav {
    display: none;
  }
  
  @media (max-width: 1279px) {
    .navbar {
      display: none;
    }
  
    .mobile-nav {
      display: flex;
      gap: 2rem; /* gap-8 */
    }
  }
